import React from "react";
import NavbarOption from "./NavbarOption";
import Stack from "@mui/material/Stack";
import Button from "@mui/material/Button";
import "./userportal.css"; // Import the CSS file for styling

function Userportalpage() {
  return (
    <div className="user-portal-page">
      <div className="button-container">
        <Stack spacing={50} direction="row">
          <Button variant="outlined">All</Button>
          <Button variant="outlined">Dogs</Button>
          <Button variant="outlined">Cats</Button>
        </Stack>
      </div>
    </div>
  );
}

export default Userportalpage;
